import Hello from "./module";
import Card from "./Card";

const App = () => {
   return (
      <div>
         <h2>Let's get started!</h2>
         <Card>
            <h1> HELLO</h1>
            <Hello item="Hello World !!!!!!!!!!!!!!!!!!"></Hello>
         </Card>
      </div>
   );
};

export default App;
